import './App.css';
import React from 'react';
import { useState, useEffect } from 'react';


export default function WeatherApp() {
  const BASE_ATX_URL = "https://api.open-meteo.com/v1/forecast?latitude=30.27&longitude=-97.74&hourly=temperature_2m"
  const BASE_DAL_URL = "https://api.open-meteo.com/v1/forecast?latitude=32.78&longitude=-96.81&hourly=temperature_2m"
  const BASE_HOU_URL = "https://api.open-meteo.com/v1/forecast?latitude=29.76&longitude=-95.36&hourly=temperature_2m"
  const [time, setTime] = useState([]);
  const [temp, setTemp] = useState([]);
  //let temperatureMap = new Map();
  let displayData
  // function pullJson() {
  //   fetch(BASE_ATX_URL)
  //     .then(response => response.json())
  //     .then(responseData => {
  //       displayData = makeDict(responseData.hourly)
  //       //console.log(responseData.hourly.time[0])
  //       setValue(displayData)
  //   })
  //   //return
  // }

  async function pullJson(URL) {
    const response = await fetch(URL)
    const responseData = await response.json()
    // console.log("Before the print of hourly")
    // console.log(responseData.hourly);
    let timeArr = responseData.hourly.time
    let tempArr = responseData.hourly.temperature_2m
    // console.log(timeArr)

    //otherFunction(timeArr, tempArr)
    // console.log({temp})
    setTime(timeArr);
    setTemp(tempArr);
    // setTemp(time: timeArr)
    //setTemp(responseData.hourly)
    // let dict = makeDict(responseData.hourly)
    // console.log("Outside of function")
    // console.log(dict)
  }

  useEffect(() => {
    pullJson(BASE_ATX_URL)
  }, []);

  function onClickATX() {
    pullJson(BASE_ATX_URL)
  }

  function onClickDAL() {
    pullJson(BASE_DAL_URL)
  }

  function onClickHOU() {

  }

  return (<>
    <h2> Hello World </h2>
    <div class="container">
      <ThreeCityButtons />
      <ForecastHeader />
      < DataSet />
    </div>
    <h2> Goodbye</h2>
  </>)

  function ThreeCityButtons() {
    return (
      <div class="row">
        <div class="col">
          <button id="ATX-btn" onClick={onClickATX}> <b> Austin </b> </button>
        </div>
        <div class="col">
          <button id="DAL-btn" onClick={onClickDAL}> <b> Dallas </b> </button>
        </div>
        <div class="col">
          <button id="HOU-btn"> <b> Houston </b> </button>
        </div>
      </div>
    )
  }

  function ForecastHeader() {
    return (
      <div class="row">
        <div class="col-4">
          <b>Time</b>
        </div>
        <div class="col">
          <b>Temperature</b>
        </div>
      </div>
    )
  }
  function DataRow({ idx }) {
    return (
      <div class="row">
        <div class="col-4">
          {time[idx].substring(11)}
        </div>
        <div class="col">
          {temp[idx]} F
        </div>
      </div>
    )
  }

  function DataSet() {
    const returnValue = [];
    for (let i = 13; i < 24; i++) {
      returnValue.push(<DataRow idx={i} />)
    }
    return returnValue
  }

}
